;; gorilla-repl.fileformat = 1

;; **
;;; # Find shapes with hough circles
;;; 
;;; This tutorial shows how to find shape with a given color within an image.
;; **

;; @@
(ns combative-atoll
  (:require
   [opencv3.core :refer :all]
   [opencv3.utils :as u]))


;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def bgr-image
  (-> "resources/detect/circles.jpg" imread (u/resize-by 0.5) ))
(u/mat-view bgr-image)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"256\" height=\"256\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x31da1208 \"BufferedImage@31da1208: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 256 height = 256 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def ogr-image
  (-> bgr-image
   (clone)
   (median-blur! 3)
   (cvt-color! COLOR_BGR2HSV)
   (in-range! (new-scalar 0 100 100) (new-scalar 10 255 255))
   (gaussian-blur! (new-size 9 9) 2 2)))
(u/mat-view ogr-image)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"256\" height=\"256\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4ee2840c \"BufferedImage@4ee2840c: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@75c6fdd8 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 256 height = 256 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; **
;;; Let's find the circles using the **hough-circles** function from opencv core.
;; **

;; @@
(def circles (new-mat))
(hough-circles ogr-image circles CV_HOUGH_GRADIENT 1 (/ (.rows bgr-image) 8) 100 20 0 0)
(dotimes [i (.cols circles)]
  (let [ circle (.get circles 0 i) x (nth circle 0) y (nth circle 1) r (nth circle 2)  p (new-point x y)]
  (opencv3.core/circle bgr-image p (int r) (new-scalar 0 255 0) 5)))
(u/mat-view bgr-image)
